[TextBlock(text='[
  {
    "sid": "50106",
    "Technique ID": "T1557",
    "Technique name": "Adversary-in-the-Middle",
    "Quotes": ["Adversaries may attempt to position themselves between two or more networked devices using an adversary-in-the-middle (AiTM) technique to support follow-on behaviors such as Network Sniffing, Transmitted Data Manipulation, or replay attacks (Exploitation for Credential Access)"],
    "Explanation": "This rule detects an attempt by the Responder tool to perform an AiTM attack by poisoning the SMB protocol and responding to client requests before the legitimate server, allowing the attacker to capture credentials or relay them to other systems."
  }
]', type='text')][TextBlock(text='[
  {
    "sid": "50106",
    "Technique ID": "T1557",
    "Technique name": "Adversary-in-the-Middle",
    "Quotes": ["Adversaries may attempt to insert themselves into communication channels between two networks, hosts, or processes to intercept and potentially alter communications."],
    "Explanation": "This rule detects an attempt to perform an SMB relay attack, which is a type of adversary-in-the-middle attack where the attacker relays SMB authentication requests to a remote server to gain unauthorized access. The rule looks for specific content in the SMB traffic that indicates a poisoner attack attempt."
  }
]', type='text')][TextBlock(text='[
  {
    "sid": "50106",
    "Technique ID": "T1557",
    "Technique name": "Adversary-in-the-Middle",
    "Quotes": ["Adversaries may attempt to insert themselves into communication channels between two networks, systems, or internet services in order to obtain data for exfiltration or intercept communications for other malicious purposes."],
    "Explanation": "This rule detects an attempt by the Responder tool to perform an adversary-in-the-middle attack by poisoning the SMB protocol and intercepting traffic between systems on the network."
  },
  {
    "sid": "50106",
    "Technique ID": "T1584",
    "Technique name": "Compromise Client Software Binary",
    "Quotes": ["Adversaries may exercise the ability to replace legitimate software binaries with malicious ones as a way to gain persistence and potentially execute code at a higher privilege level than the current user."],
    "Explanation": "The Responder tool attempts to respond to SMB requests before the legitimate server, which could allow the adversary to deliver a compromised binary to the client system."
  }
]', type='text')][TextBlock(text='[
  {
    "sid": "50106",
    "Technique ID": "T1557",
    "Technique name": "Adversary-in-the-Middle",
    "Quotes": ["Adversaries may attempt to insert themselves into communication channels between two networks, hosts, or processes to intercept and potentially alter communications."],
    "Explanation": "This rule detects an attempt by the Responder tool to perform an SMB relay attack, which is a type of adversary-in-the-middle attack. The rule looks for specific content in the SMB protocol that indicates the Responder tool is attempting to poison the SMB session and insert itself between the client and server."
  }
]', type='text')][TextBlock(text='[
  {
    "sid": "50106",
    "Technique ID": "T1557",
    "Technique name": "Adversary-in-the-Middle",
    "Quotes": ["Adversaries may attempt to insert themselves into communication channels between two legitimate hosts to gain access to data flows."],
    "Explanation": "This rule detects an attempt by the Responder tool to perform an SMB relay attack, which is a type of adversary-in-the-middle attack targeting the SMB protocol. The rule looks for specific content in SMB traffic that indicates the Responder tool is attempting to poison the SMB session."
  }
]', type='text')][TextBlock(text='[
  {
    "sid": "50106",
    "Technique ID": "T1557",
    "Technique name": "Adversary-in-the-Middle",
    "Quotes": ["Adversaries may attempt to insert themselves into communication channels between two networks, hosts, or processes to intercept and potentially alter communications."],
    "Explanation": "This rule detects an attempt by the Responder tool to perform an SMB relay attack, which is a type of adversary-in-the-middle attack. The Responder tool responds to SMB requests with a poisoned response, attempting to insert itself into the communication channel."
  }
]', type='text')][TextBlock(text='[
  {
    "sid": "50106",
    "Technique ID": "T1210",
    "Technique name": "Exploitation of Remote Services",
    "Quotes": ["Adversaries may exploit remote services to gain unauthorized access to internal systems once inside of a network"],
    "Explanation": "This rule detects an attempt to exploit the SMB service (port 445) by a tool called Responder, which is used for poisoning and capturing credentials from the SMB protocol. The exploitation of remote services like SMB is a common technique used by adversaries to gain initial access or move laterally within a network."
  }
]', type='text')][TextBlock(text='[
  {
    "sid": "50106",
    "Technique ID": "T1557",
    "Technique name": "Adversary-in-the-Middle",
    "Quotes": ["Adversaries may attempt to insert themselves into communication channels between two networks, systems, or operators to intercept and/or manipulate network traffic."],
    "Explanation": "This rule detects an attempt by the Responder tool to perform an SMB relay attack, which is a type of adversary-in-the-middle attack. The Responder tool responds to SMB requests with a poisoned response, attempting to insert itself between the client and server."
  }
]', type='text')][TextBlock(text='[
  {
    "sid": "50106",
    "Technique ID": "T1557",
    "Technique name": "Adversary-in-the-Middle",
    "Quotes": ["Adversaries may attempt to insert themselves into communication channels between two legitimate hosts to gain access to data flows."],
    "Explanation": "This rule detects an attempt by the Responder tool to perform an SMB relay attack, which is a type of adversary-in-the-middle attack. The rule looks for a specific pattern in the SMB traffic that indicates the Responder tool is attempting to poison the SMB session and insert itself between the client and server."
  }
]', type='text')][TextBlock(text='[
  {
    "sid": "50106",
    "Technique ID": "T1557",
    "Technique name": "Adversary-in-the-Middle",
    "Quotes": ["Adversaries may attempt to insert themselves into communication channels between two legitimate hosts to gain access to data flows."],
    "Explanation": "This rule detects an attempt by the Responder tool to perform an adversary-in-the-middle attack by poisoning the SMB protocol and responding to client requests before the legitimate server, allowing the attacker to capture credentials and other sensitive data."
  },
  {
    "sid": "50106",
    "Technique ID": "T1194",
    "Technique name": "Deobfuscate/Decode Files or Information",
    "Quotes": ["Adversaries may use obfuscated/encoded data to hide command and control traffic. They may also attempt to decode/deobfuscate that traffic before passing it along to another component to bypass inspection."],
    "Explanation": "The Responder tool used in this attack often employs obfuscation or encoding techniques to hide its malicious traffic, which would need to be decoded before being passed to the command and control server."
  }
]', type='text')][TextBlock(text='[
  {
    "sid": "50106",
    "Technique ID": "T1557",
    "Technique name": "Adversary-in-the-Middle",
    "Quotes": ["Adversaries may attempt to insert themselves into communication channels between two networks, systems, or operators to intercept and potentially alter communications."],
    "Explanation": "This rule detects an attempt by the Responder tool to perform an SMB relay attack, which is a type of adversary-in-the-middle attack targeting the SMB protocol. The rule looks for specific content in SMB traffic that indicates the Responder tool is attempting to poison the SMB connection."
  }
]', type='text')]

