[TextBlock(text='[
  {
    "sid": "10088",
    "Technique ID": "T1056",
    "Technique name": "Input Capture",
    "Quotes": ["Input Capture techniques involve intercepting and capturing user input data, such as keystrokes, to obtain sensitive information."],
    "Explanation": "This rule detects activity related to the Beyond Keylogger malware, which is designed to capture keystrokes and other user input data from the victim's system."
  },
  {
    "sid": "10088", 
    "Technique ID": "T1020",
    "Technique name": "Automated Exfiltration",
    "Quotes": ["Adversaries may exfiltrate data, such as sensitive documents, through the use of automated processing after being gathered during Collection"],
    "Explanation": "The rule looks for emails sent by the Beyond Keylogger malware, which likely contains exfiltrated keylogger data being sent out via SMTP, indicating automated exfiltration of captured data."
  }
]', type='text')][TextBlock(text='[
  {
    "sid": "10088",
    "Technique ID": "T1056",
    "Technique name": "Input Capture",
    "Quotes": ["Input Capture techniques involve intercepting and capturing user input data, such as keystrokes, to obtain sensitive information."],
    "Explanation": "This Snort rule detects activity related to the 'Beyond Keylogger' malware, which is designed to capture user keystrokes (input data) and send logs via SMTP. The rule looks for specific patterns in the email subject line that indicate the presence of a keylogger report."
  },
  {
    "sid": "10088", 
    "Technique ID": "T1071",
    "Technique name": "Application Layer Protocol",
    "Quotes": ["Adversaries may use an application layer protocol for communication between host and C2 server or among nodes within a service."],
    "Explanation": "The rule detects the keylogger sending data over SMTP (Simple Mail Transfer Protocol), which is an application layer protocol used for email communication. Adversaries often abuse legitimate protocols like SMTP to blend in with normal network traffic."
  }
]', type='text')][TextBlock(text='[
  {
    "sid": "10088",
    "Technique ID": "T1056",
    "Technique name": "Input Capture",
    "Quotes": ["Input Capture techniques involve intercepting and capturing user input data, such as keystrokes, to obtain sensitive information."],
    "Explanation": "This rule detects activity related to the 'Beyond Keylogger' malware, which is designed to capture keystrokes and send logs via SMTP. The rule looks for specific patterns in the email subject line that indicate the presence of a keylogger report."
  },
  {
    "sid": "10088", 
    "Technique ID": "T1071",
    "Technique name": "Application Layer Protocol",
    "Quotes": ["Adversaries may use an application layer protocol for communication between host and C2 server or among hosts within a network."],
    "Explanation": "The rule detects the use of SMTP (port 25) for sending keylogger data, which falls under the Application Layer Protocol technique where common protocols like SMTP are abused for command and control communication."
  }
]', type='text')][TextBlock(text='[
  {
    "sid": "10088",
    "Technique ID": "T1115",
    "Technique name": "Clipboard Data",
    "Quotes": ["Adversaries may collect data stored in the clipboard from users copying information within or between applications"],
    "Explanation": "This rule detects activity related to the 'Beyond Keylogger' malware, which is designed to capture and exfiltrate keystrokes and clipboard data from the victim's system. The rule looks for emails with a specific subject line pattern that indicates the keylogger is sending captured data via SMTP."
  }
]', type='text')][TextBlock(text='[
  {
    "sid": "10088",
    "Technique ID": "T1056",
    "Technique name": "Input Capture",
    "Quotes": ["\"Input Capture techniques involve intercepting and capturing user input data, such as keystrokes, to obtain sensitive information.\""],
    "Explanation": "This rule detects activity related to the 'Beyond Keylogger' malware, which is designed to capture user input data, such as keystrokes, and send logs via SMTP."
  },
  {
