    "Technique name": "Application Layer Protocol",
    "Quotes": ["\"Adversaries may use an application layer protocol for communication between host and C2 server or among nodes within a service.\""],
    "Explanation": "The rule looks for SMTP traffic containing specific patterns indicative of the 'Beyond Keylogger' malware, which uses SMTP as an application layer protocol to exfiltrate captured data."
  }
]', type='text')][TextBlock(text='[
  {
    "sid": "10088",
    "Technique ID": "T1056",
    "Technique name": "Input Capture",
    "Quotes": ["Adversaries may attempt to capture user input on a system to obtain credentials and other sensitive information."],
    "Explanation": "This rule detects activity related to the Beyond Keylogger malware, which is designed to capture user input such as keystrokes to steal sensitive information like credentials. The rule looks for emails with a specific subject line indicating a report from the keylogger being sent over SMTP."
  },
  {
    "sid": "10088", 
    "Technique ID": "T1041",
    "Technique name": "Exfiltration Over C2 Channel",
    "Quotes": ["Adversaries may steal data by exfiltrating it over an existing command and control channel."],
